import React from "react";
import { Link } from "react-router-dom";
import Logo from "../../pages/Logo";

export default function Nav({ LinkArray }) {
  return (
    <nav>
      <Logo/>
      <ul>
        {LinkArray.map((link) => (
          <li key={link.id}>
            <Link to={link.path}>{link.label}</Link>
          </li>
        ))}
      </ul>
    </nav>
  );
}
